css:
@-moz-document domain("www.reddit.com") {
.icon-upvote{
    background-image: url(https://vignette.wikia.nocookie.net/the-rising-of-the-shield-hero/images/9/95/Raphtalia_Anime.png/revision/latest?cb=20181111114943);
    background-size: 100% 100%;
    position: absolute;
    width: 20px;
    height: 32px;
    top: 0px;
    left: 5px;
    z-index: 1000;
    }
.icon-downvote{
    background-image: url(https://vignette.wikia.nocookie.net/the-rising-of-the-shield-hero/images/c/c2/Malty_Anime.png/revision/latest?cb=20181210092721);
    background-size: 100% 100%;
    position: absolute;
    width: 20px;
    height: 32px;
    top: 47px;
    left: 5px;
    z-index: 1000;
    -webkit-transform: rotate(180deg);
    -moz-transform: rotate(180deg);
    -ms-transform: rotate(180deg);
    -o-transform: rotate(180deg);
    transform: rotate(180deg);
    }
.icon-upvote:before{
content:"";
}
.icon-downvote:before{
content:"";
}
}
